Jet Stream (1993) [VHSRip]

Sarah Jane Hamilton plays a successful TV weather presenter. Peter North
watches her on TV and really has the hots for her. She seems to be a prim
and proper type unlike some of the people she works with. She doesn't
seem quite as prim and proper when she goes home to her cute Asian room
mate. Peter's friend has a nice time going through Sarah Jane's producer
to try to arrange a meeting between Sarah Jane and Peter. Eventually
they do meet and it's fireworks as the film culminates with an explosive
scene in which Sarah Jane cums multiple times and Peter finishes off
all over her nicely. All she can say at the end of it is &quot;Oh my God!&quot;.

